import React from 'react';

class Weather extends React.Component {
    render() {
        return (
            <div>
                {this.props.name},
                {this.props.temp},
                {this.props.humidity},
                {this.props.pressure},
                {this.props.error}
            </div>
        )
    }
}

export default Weather;
